I'm not voting stars here, so be calm.

@Betsie, I LOVE your style - in your review more than the book. That's a compliment! your refreshing self-insight is great stuff.  I now assume you were assigned this book. Listeners are not given information on whether the reader self-selected; I always assume they did. My bad. I wish there were a space for the reader to say a few sentences about how they became involved in the piece and what artistic choices they made in reading the piece. Maybe each reader could give the first "review"? Thanks for agreeing to read when the site asks you to.

@ Parsnips. Let's try to be accurate in our statements.  You very wrongly assert that Shadows_Girl is always trashing Librivox readings. I checked - that not at all true. See, e.g., The White People.  Shaodows_Girl most often reviews movies and radio. 

@Shadows_Girl. I like critic s who are willing to give an honest rating. (I've been told to "be NICE or say nothing", advice I shall ignore). However, I would be interested to see you give us more basis than you do.  It's not true that Librivox listeners are LAZY.  Neither can any movie be considered a substitute for the original book. So, thanks, but stay on topic; let's comment on the piece and the performance.
